import React from "react";
import "./cart-item.styles.scss";

const CartItem = ({ item: { imageUrl, price, quantity } }) => (
  <div className="cart-item">
    <div>{price}</div>
    <div>{quantity}</div>
  </div>
);

export default CartItem;
